def PolyArea(x, y):
    return 0.5 * np.abs(np.dot(x, np.roll(y, 1)) - np.dot(y, np.roll(x, 1)))

def getCategoryID(classification):
    classification_ID=""

    if classification == "animal":
        classification_ID = 7
        classification_name= "animal"
    elif classification.split(".")[0] == "human":
        classification_ID = 6
        classification_name = "human"
    elif classification.split(".")[0] == "movable_object":
        classification_ID = 8
        classification_name = "movable_object"
    elif classification.split(".")[0] == "static_object":
        classification_ID = 9
        classification_name = "static_object"
    elif classification.split(".")[0] == "vehicle":
        if classification.split(".")[1] == "bicycle":
            classification_ID = 2
            classification_name = "bicycle"
        elif classification.split(".")[1] == "car":
            classification_ID = 1
            classification_name = "car"
        elif classification.split(".")[1] == "motorcycle":
            classification_ID = 4
            classification_name = "motorcycle"
        elif classification.split(".")[1] == "bus":
            classification_ID = 3
            classification_name = "bus"
        elif classification.split(".")[1] == "truck" or classification.split(".")[1] == "emergency" or classification.split(".")[1] == "construction" or classification.split(".")[1] == "trailer":
            classification_ID = 5
            classification_name = "truck"

    return str(classification_ID), classification_name

def create_COCO_individual_labels(boxes, categories, imagePath, height, width):
    label = '{\n  "version": "4.2.9",\n  "flags": {},\n  "shapes": [\n'

    for index in range(0, len(boxes)):
        box = boxes[index]
        _, class_object = getCategoryID(categories[index])

        label = label + '\t{\n'
        label = label + '\t  "label": "' + str(class_object) + '",\n'
        label = label + '\t  "points": [\n'

        label = label + '\t\t[\n'
        label = label + '\t\t  ' + str(box[0, 0]) + ',\n'
        label = label + '\t\t  ' + str(box[1, 0]) + ',\n'
        label = label + '\t\t],\n'

        label = label + '\t\t[\n'
        label = label + '\t\t  ' + str(box[0, 1]) + ',\n'
        label = label + '\t\t  ' + str(box[1, 1]) + ',\n'
        label = label + '\t\t],\n'

        label = label + '\t\t[\n'
        label = label + '\t\t  ' + str(box[0, 2]) + ',\n'
        label = label + '\t\t  ' + str(box[1, 2]) + ',\n'
        label = label + '\t\t],\n'

        label = label + '\t\t[\n'
        label = label + '\t\t  ' + str(box[0, 3]) + ',\n'
        label = label + '\t\t  ' + str(box[1, 3]) + ',\n'
        label = label + '\t\t]\n'

        label = label + '\t  ]\n'
        label = label + '\t  "group_id": null,\n'
        label = label + '\t  "shape_type": "polygon",\n'
        label = label + '\t  "flags": {}\n'

        label = label + '\t},\n'

    label = label[:-2] + '\n'
    label = label + '  ],\n'
    label = label + '  "imagePath": "' + str(imagePath) + '",\n'
    label = label + '  "imageData": "",\n'
    label = label + '  "imageHeight": ' + str(height) + ',\n'
    label = label + '  "imageWidth": ' + str(width) + '\n'
    label = label + '}'

    return label






